import React from 'react'
import './AboutUs.css'

const AboutUs = () => {
    return (
        <div className="content" id='about-us'>
            <div className="aboutContainer">
                <div className="aboutCol aboutImg"></div>
                <div className="aboutCol aboutContent"></div>
            </div>
        </div>
    )
}

export default AboutUs
